DROP TABLE IF EXISTS `COBRANCA_DEV`;

CREATE  VIEW `COBRANCA_DEV`  AS  select `cobranca`.`idpagto` AS `IDPAGTO`,`cobranca`.`socioid` AS `SOCIOID`,`cobranca`.`ano` AS `ANO`,`cobranca`.`mes` AS `MES`,`cobranca`.`datapagto` AS `DATAPAGTO`,`cobranca`.`valor` AS `VALOR`,`cobranca`.`situacao` AS `SITUACAO`,(case `cobranca`.`mes` when 'Janeiro' then 1 when 'Fevereiro' then 2 when 'Marco' then 3 when 'Abril' then 4 when 'Maio' then 5 when 'Junho' then 6 when 'Julho' then 7 when 'Agosto' then 8 when 'Setembro' then 9 when 'Outubro' then 10 when 'Novembro' then 11 when 'Dezembro' then 12 end) AS `MESN` from `cobranca` where (`cobranca`.`situacao` <> 'pago') ;

