INSERT INTO `informativos` (`id`, `informativo`, `flagmostrar`, `lido`) VALUES
(1, 'teste de informativo', 'N', 'S'),
(2, 'testando novamente informativo', 'N', 'S'),
(3, 'Prezado usuario. Este campo disponibiliza-ra Informações relevantes ao sistema e aos dados do mesmo! Como este novas funcionalidades estão sendo desenvolvidas, Aguardem novidades! Você pode utilizar o sistema normalmente! Para que haja uma boa comunicação entre desenvolvedores e usuarios Faz-se necessário a confirmação da leitura deste, apenas clicando no Botão \"Confirmo ter lido\" logo abaixo. ', 'N', 'S'),
(4, 'Prezado Usuario! Conforme você já deve ter percebido, algumas novas implementações estão sendo realizadas. Como alguns relatórios, impressão do boleto do sistema e o Módulo de Suporte. Neste você poderá  tirar dúvidas, e até solicitar novas implementações como por exemplo um novo relatório! Para abrir uma solicitação de suporte acesse o Módulo Suporte e clique em abrir nova solicitação em em breve responderemos ao seu chamado. Gratos pela atenção. Tenham um Bom dia! ', 'N', 'S'),
(5, 'Prezado usuario! A equipe de desenvolvimento elaborou alguns mecanismos de varreduras, para evitar alguns problemas futuros, conforme essas varreduras e filtragens vão sendo processadas, nos estaremos lhes repassando maiores informações, e de inicio foram detectados 3 registros(Cadastro de sócios Matriculas: 6623, 1406 e 6664), faltando dados principais como o \"Nome\", isso pode ter sido por falta de conexão com a internet. Verifique, e se necessário edite atraves do Menu/Editar Sócio. Quaisquer dúvidas Solicite Suporte para maiores esclarecimentos. Gratos pela compreensão, Tenham um bom dia!..', 'N', 'S'),
(6, 'Prezado usuario! A equipe de desenvolvimento atendeu a sua solicitação. Se possivel responder ao chamado em menu/Suporte, repassando-nos uma posição, para que o mesmo seja dado por encerrado! Lembrando que quaisquer dúvidas Solicite Suporte para maiores esclarecimentos. Gratos pela compreensão, Tenham um bom dia!..', 'N', 'S'),
(7, 'Prezado Usuário! respondemos ao seu chamado. Verifique em suporte. Aguardamos sua resposta. Obrigado pela Atenção. Tenham um bom dia!', 'N', 'S'),
(8, 'Prezado Usuario. Implementemos \"Geração de Recibo no ato do pagamento das cobranças\". Pedimos que quando forem imprimir, verifiquem as informações impressas no recibo, falha na conexão com a internet ou outros fatores podem invalidar o recibo. Lembrando que caso isso ocorra, nós Desenvolvedores não nos responsabilizamos. Quaisquer duvidas Solicite suporte. Tenham um bom dia!', 'N', 'S'),
(9, 'Prezado usuario! Respondemos aos suas solicitações de suporte, Há 2 solicitações pendentes de sua resposta. Verifique em Suporte. Gratos pela atenção. Boa tarde!', 'N', 'S'),
(10, 'Respondemos suas solicitações de suporte. Verifique. Se possivel responder para darmos continuidade. Gratos, Tenham um bom dia!', 'N', 'S'),
(11, 'Lembrete! É possivel imprimir Boleto do sistema para pagamento através do Menu / Financeiro / Imprimir Boleto do sistema.', 'P', 'N'),
(12, 'Prezado Usuario. Implementemos \"Validação do número de matricula e nome no Cadastro de novo sócio\". Essas verificam a existência de cadastro na matricula em questão e o nome se esta em branco. Lembrando que caso ocorram erros, nos reportem para que possamos lhes auxiliar. Quaisquer duvidas Solicite suporte. Tenham um bom dia!', 'N', 'S'),
(13, 'Prezado Usuario. Implementemos Próximo a novembro/2012 a \"Validação do ano das cobranças\" que impedirá que erros aconteçam referênte a duplicidade de cadastro de cobrança. Porém antes dessa implementação algumas inconsistências foram detectadas nos cadastros 6457, 3592, 6001, 3732 e 2764. Gostariamos que valida-se estes cadastros se as cobranças estão corretas. Reforçamos o lembrete de que problemas de duplicidade nas cobranças não mais acontecerão. Caso algum dos cadastros citados estejam com cobranças incorretas ou tenha alguma duvida, Solicite suporte. Tenham um bom dia!', 'N', 'S'),
(14, 'Prezado Usuário. Implementemos \"Melhorias na usabilidade do Cadastro de cobranças\". informa-mos que se desejar, ainda é possivel Imprimir Recibos e efetuar pagamentos individualmente como antes era feito(clicando no icone de impressora ou icone de dinheiro \'Pagar\'), Foram implementadas varias melhorias, uma delas é a caixa de marcação(checkbox), que lhe permite Imprimir vários recibos ao mesmo tempo, Efetuar vários pagamentos ao mesmo tempo e personalizar novos cadastros. Pedimos que para melhor conhecimento do mesmo efetuem testes utilizando o cadastro de sócio de testes Matricula número 88888, Favor responder ao chamado aberto pelo suporte referênte este assunto!', 'N', 'S'),
(15, 'Prezado Usuário. Implementemos \"Filtro de componete auto-complete para Campos Endereço 1 e 2\". e também disponibilizamos a alguns dias os Boletos para pagamento das mensalidades através do menu principal / Financeiro / Imprimir Boleto do Sistema Vencimento Abril/2013 Maio/2013 e Junho/2013, Através destes é possivel efetuar a impressão dos boletos, e logo, no ato do pagamento em banco o recibo presente é destacado, autenticado e entregue. Evitando assim quaisquer transtornos referêntes aos pagamentos. Em breve estaremos efetuando melhorias nos resultados do filtro implementado e demais componentes do sistema. Quaisquer duvidas Solicite suporte. Tenham um bom dia!', 'N', 'S');
