INSERT INTO `respostas` (`idresposta`, `nome`, `texto`, `data`, `idsuporte`) VALUES
(1, 'Usuario', 'preciso ajuda teste', '2012-11-17', 1),
(2, 'Suporte', 'resposta do suporte numero 1', '2012-11-17', 1),
(4, 'Usuario', 'teste resposta usuario 2', '2012-11-19', 1),
(6, 'Usuario', 'teste resposta usuario 3', '2012-11-19', 1),
(8, 'Suporte', 'Este log do Suporte consiste no encerramento deste chamado. Tornando como status inativo.', '2012-11-19', 1),
(13, 'Usuario', 'Criar campo cidade atual no cadastro de socios e utilizar o mesmo na tela de pesquisa/Seleção informando assim os sócios por determinadas cidades', '2012-11-27', 5),
(14, 'Suporte', 'Caro usuário, atendemos sua solicitação, gostaria então, de que você avalia-se a nova implementação e se possível, responder a este chamado, confirmando com um OK a funcionalidade do mesmo, ou reportando erros, ou quaisquer informações que queira nos repassar. Gratos pela compreensão! ', '2012-11-27', 5),
(15, 'Usuario', 'a ficha 50 esta com problema no campo data de aniversario ', '2012-12-01', 6),
(16, 'Usuario', 'estamos vendo por favor aguarde', '2012-12-01', 6),
(17, 'Usuario', 'ok', '2012-12-01', 5),
(18, 'Suporte', 'Este log do Suporte consiste no encerramento deste chamado. Tornando como status inativo.', '2012-12-03', 5),
(19, 'Suporte', 'Este log do Suporte consiste no encerramento deste chamado. Tornando como status inativo. Chamado aberto para exemplificar ao usuário. ', '2012-12-03', 6),
(20, 'Usuario', 'nao consigo vizualiza as ficha acho os ome e nao as fichas.', '2012-12-04', 7),
(23, 'Usuario', 'Bom dia jonas,o valor quando pago o ano todo sai de 4,00 R$.e nao sai Recibo.ha ficha de valdecir 4455foi pg so ate abril de 2012 nao consigo apagar o restante.ATT Elisiane', '2012-12-06', 9),
(22, 'Suporte', 'Caro usuário! a fim de solucionar seu problema, poderia nos repassar maiores detalhes? como, qual o numero da matricula que vocês estão com problema ou qual o nome do sócio? ou responder a este chamado, caso o problema não ocorre mais? caso ocorra, ficamos gratos por maiores detalhes, e o mais breve possivel lhe respondere-mos. Tenham um bom dia!', '2012-12-04', 7),
(24, 'Suporte', 'Bom dia! Elisiane Verifiquei no cadastro citado e apresenta que todos os titulos até dezembro foram pagos na data de hoje 06/12/2012. No cadastro apresenta um icone de impressora ao lado do valor, onde pode visualizar o recibo. Favor responder a este chamado caso o problema ainda exista ou não, para finalizarmos ou dar continuidade. Gratos pela atenção.', '2012-12-06', 9),
(25, 'Suporte', 'Elisiane, acho que houve um mal entendido, e a resposta acima pode ser desconsiderada. Voltando a situação, sobre o valor de 4 foi atualizado para 5. Referente a impressão do recibo atualmente deve ser feito um a um. Posteriormente estaremos abrindo um projeto e consequentemente a implementação de Recibo do ano inteiro. e sobre o Cadastro  de valdecir, atualizemos as informações de cobrança. gostariamos que você valida-se e informase-nos se esta correto? ', '2012-12-06', 9),
(35, 'Suporte', 'Este log do Suporte consiste no encerramento deste chamado. Tornando como status inativo. Informações do log acima inconsistentes.', '2012-12-20', 7),
(27, 'Usuario', 'oi tem como digitalizar as ficha e depois achar pelo nome e n°.', '2012-12-18', 11),
(28, 'Suporte', 'Oi, Seu desejo seria de digitalizar/scannear as fichas, correto? Se sim, é possivel, porem tem um custo de R$ 0,10 Centavos por ficha e demora de 1 a 2 dias para estar disponivel para consulta no sistema. Um método automatico ainda não é possivel, pois ainda não existe. Se desejas enviar fichas digitalizadas responda a este email, com um ok, para projetarmos uma forma de envio. Caso contrario solicite o cancelamento deste chamado.', '2012-12-18', 11),
