(41, 'Usuario', 'Ficha N° 2765 nao consigo salvar.', '2013-01-18', 13),
(46, 'Suporte', 'Prezado usuário, referente a Matricula 4953 localizamos cadastrado no sistema com o nome de Basilio Edegar Scull, e mais alguns dados cadastrados, gostaríamos que analisa-se este cadastro, e nos reporta-se se esta correto, caso precise editar o cadastro pode ser feito através do menu principal Editar, localizando pelo cadastro que se encontra no grupo dos Sócios de Bom Jesus do Sul. E sobre o problema de o sistema apresentar erro para os casos citados, [Continua Próximo log...>]', '2013-01-19', 15),
(43, 'Usuario', 'ficha 4953 nao salva ao ser cadastrada.', '2013-01-18', 15),
(44, 'Suporte', 'Prezado usuário, identificamos que o motivo deste ocorreu porque cadastro com numero 2765 já existia, houve uma tentativa de cadastro com esse numero de matricula em 05-12-2012 mas este cadastro por algum motivo(falha na conexão com a internet, oscilações de energia, ou outros fatores) foi realizado sem informações nenhuma exceto o numero da matricula. Para melhor auxiliar neste caso, Como o cadastro deste 2765 estava vazio, decidimos elimina-lo da base de dados. [Continua Próximo log..>] ', '2013-01-19', 13),
(45, 'Suporte', 'Tornando possível uma nova tentativa de cadastro com o mesmo numero. Caso ocorra outros erros ou ainda não consiga. Responda a este chamado informando-nos para podermos auxiliar melhor. Gratos pela compreensão.', '2013-01-19', 13),
(47, 'Suporte', 'já esta sendo implementado validações para que este erro não ocorra mais, ao decorrer desta implementação orientações serão passadas ao usuário quando cadastros já existirem. Maiores informações serão repassadas conforme necessário. O sistema pode ser utilizado normalmente. Grato pela compreensão', '2013-01-19', 15),
