(51, 'Usuario', '', '2013-02-14', 16),
(52, 'Suporte', 'Prezado usuário. atualizamos as informações de cobrança referente ao sócio de matricula 6877. Gostaria então que valida-se se as informações de cobrança deste cadastro estão corretas. Caso correto Favor responder a este chamado com um Ok para assim prosseguir com a baixa deste chamado, caso incorreto ou tenha alguma dúvida, responda a este chamado informando e o mais breve possível responderemos. [Continua Próximo log..>]', '2013-02-14', 16),
(53, 'Suporte', 'Informamos também que foi aberto um projeto para melhorias na usabilidade do Módulo de cadastro de cobranças dos sócios. Maiores informações serão repassadas através da opção \"Informativos\" conforme o andamento do mesmo. Gratos pela compreensão, Tenham um bom dia!', '2013-02-14', 16),
