(66, 'Suporte', 'Este log do Suporte consiste no encerramento deste chamado. Tornando como status inativo. Log anterior em branco, entendido como solucionado.', '2013-02-24', 19),
(67, 'Suporte', 'Prezado Usuário. Implementemos \"Melhorias na usabilidade do Cadastro de cobranças\". informa-mos que se desejar, ainda é possivel Imprimir Recibos e efetuar pagamentos individualmente como antes era feito(clicando no icone de impressora ou icone de dinheiro), Foram implementadas várias melhorias, uma delas é a caixa de marcação(checkbox), que lhe permite Imprimir varios recibos ao mesmo tempo, efetuar vários pagamentos ao mesmo tempo e personalizar novos cadastros. [Continua Próximo log>...]', '2013-02-24', 20),
(68, 'Suporte', 'Pedimos que para melhor conhecimento do mesmo efetuem testes utilizando o cadastro de sócio de testes Matricula número 88888, Pedimos também a atenção para quando marca-los(marcar, efetuar procedimento escolhido, voltar a paginá ), pois por intermédio do navegador ao voltar paginá do cadastro essas caixas de marcação podem continuar marcadas, podendo causar alguma ação indesejada caso clicado nos botões de ações disponíveis. Maiores dúvidas solicite suporte. [Continua Próximo log>...]', '2013-02-24', 20),
(69, 'Suporte', 'Aguardamos uma resposta a este chamado para melhor relacionamento Desenvolvedor x Usuário, apenas para conhecimento de ambos do seu correto funcionamento. Caso não haja problemas relacionado a esta implementação favor responder com um ok para prosseguir com a baixa deste chamado, caso ocorram problemas, cite-os para então prosseguir-mos com a manutenção. Gratos pela compreensão tenham um bom dia!', '2013-02-24', 20),
(70, 'Usuario', 'ok', '2013-02-25', 20),
(71, 'Suporte', 'Este log do Suporte consiste no encerramento deste chamado. Tornando como status inativo. Melhorias na usabilidade do Módulo de cobranças implementado e estável.', '2013-02-25', 20),
(72, 'Usuario', 'ok', '2013-02-26', 12),
(73, 'Usuario', 'Estamos com problema ao reeditar as fichas: pois salvei uma ficha sem terminar de editar e agora nao consigo salvar e nem encontrar ela .so acho ela na pesquisa avançada,mas nao consigo terminar de editar ficha 5084.', '2013-02-28', 21),
(74, 'Suporte', 'Prezado Usuário! Implementemos uma Barra de Ferramentas, Atualmente fica disponibilizado apenas acesso A página principal e a opção de Editar a qual deve solucionar o problema citado, Lembrando que esta pode futuramente receber novas funcionalidades. Acesse novamente a ficha citada através da pesquisa avançada e selecione a opção Editar. Favor responder a este chamado com um ok para prosseguirmos com a baixa, ou caso hajam problemas cite-os para então prosseguirmos com a devida manutenção.', '2013-02-28', 21),
(75, 'Usuario', 'ok\r\n', '2013-03-01', 21),
(76, 'Suporte', 'Este log do Suporte consiste no encerramento deste chamado. Tornando como status inativo. Situação Corrigida.', '2013-03-04', 21),
(77, 'Usuario', 'presciso do recibo do mes de fevereiro.\r\nobg.', '2013-03-06', 22),
(78, 'Suporte', 'Prezado Usuário! Disponível através do Menu Principal / Financeiro / Recibo de Pagamento do Sistema 1/1.\r\nDeclaração detalhada. Servindo o mesmo Documento, como recibo para os meses descritos.\r\nDocumento disponível on-line, Caso necessitem, dispomos a assinatura em tempo a combinar.\r\nQuaisquer dúvidas solicite aqui. Caso este Atenda sua necessidade favor responder este chamado com um ok para prosseguirmos com a baixa do mesmo. Tenham um bom dia!', '2013-03-06', 22),
(79, 'Usuario', 'ok\r\n', '2013-03-07', 22),
(80, 'Suporte', 'Este log do Suporte consiste no encerramento deste chamado. Tornando como status inativo. Solicitação atendida.', '2013-03-07', 22),
(81, 'Suporte', 'Este log do Suporte consiste no encerramento deste chamado. Tornando como status inativo. Solicitação já foi atendida em outro chamado.', '2013-03-07', 18),
(82, 'Usuario', 'presciso do recibo do mes de fevereiro.\r\nElisiane', '2013-03-25', 23),
(83, 'Suporte', 'Bom dia Elisiane. Qual Recibo exatamente precisa? Pois o Recibo(inclusive mês Fevereiro) esta disponível através do menu principal Financeiro/ Recibo Pagamento do Sistema 1/1, Estando em aberto apenas R$ 100,00 ref. a parcela com vencimento em 20/03. Caso gostaria de efetuar este pagamento, podemos gerar um novo boleto com vencimento para 28/03 Caso deseje. Aguardamos maiores detalhes. Gratos pela compreensão. Tenham um bom dia.', '2013-03-25', 23),
(84, 'Usuario', 'ok\r\n', '2013-03-26', 23),
(85, 'Usuario', 'Boa Tarde presciso dos recibo de janeiro , fevereiro ,março, individualmente.\r\ncaso vc nao consiga me fornecer traz o cheque de volta que eu te pago em dinheiro ,mas presciso pra logo de preferencia segunda feira.\r\nAgradeço desde já. Joao', '2013-03-26', 24),
(86, 'Suporte', 'Boa tarde, Estaremos presente sexta e Sábado em Barracão. levaremos os recibos impressos destes e também podemos esclarecer maiores duvidas relacionadas ao  sistema e utilização dos boletos caso os tenha. Se desejar informar horários de disponibilidade e local, podemos nos organizar melhor. Gratos pela compreensão. Aguardamos o Contato ou até Sexta.', '2013-03-26', 24),
(87, 'Usuario', 'ok\r\n', '2013-03-27', 24),
(88, 'Suporte', 'Este log do Suporte consiste no encerramento deste chamado. Tornando como status inativo. Titulos de pagamento gerados.', '2013-04-17', 12),
(89, 'Suporte', 'Este log do Suporte consiste no encerramento deste chamado. Tornando como status inativo. Recibos entregue, e titulos de pagamento gerados.', '2013-04-17', 24),
(90, 'Suporte', 'Este log do Suporte consiste no encerramento deste chamado. Tornando como status inativo. Recibos entregue, e titulos de pagamento gerados.', '2013-04-17', 23),
(91, 'Usuario', 'problema no desfiliar alguns clientes, exemplo adao ribas alves, não carrega informacoes dele e nao desfilia.', '2013-05-09', 25),
(108, 'Suporte', 'Ola, Informamos que o tamanho das carteirinhas foram ajustadas. Tendo uma redução considerável. Pedimos que efetuem um teste de impressão. Se possível, responder a este chamado sobre o tamanho das carteirinhas, se ficou tamanho bom, se ficou muito pequeno ou se ainda estão num tamanho grande. \r\nObrigado..', '2014-03-03', 32),
(93, 'Suporte', 'Ola, Efetuemos algumas alterações ref. ao relatório dos desfiliados, a seleção dos sócios e a geração da desfiliação, solicitamos que testem, podem utilizar o cadastro de numero 88888, conforme o possível visitaremos para maiores detalhes.  ', '2013-05-14', 25),
(94, 'Usuario', 'ok\r\n', '2013-05-16', 25),
(95, 'Usuario', 'oi td bem, estou com problema na busca rápida pois digitei o nome do homem em que eu havia acabado de cadastrar e não localizou só pelo numero da ficha que eu achei,o nome é Pedro  Fidel is Brandão.\r\ne não busca rápida não encontra digitando o nome todo.\r\n5681.\r\nAtt Elisiane', '2013-06-06', 27),
(96, 'Suporte', 'Oi Elisiane, sobre o fato mencionado o problema pode estar relacionado ao nome pesquisado, lembrando de que a pesquisa avançada não precisa digitar o nome completo, se desejar pode pesquisar por parte do nome, por exemplo: pesquisei pelo seguinte nome: \"Pedro Fidel\" e o sistema retornou as seguintes informações(sendo a segunda o registro desejado com a matricula de 5681):  \r\nMatricula	Nome\r\n3497	Pedro Fideles Brandão\r\n5681	Pedro Fideliz Brandão,\r\nEspero ter ajudado.', '2013-06-09', 27),
(97, 'Usuario', 'ok\r\n', '2013-06-10', 27),
(98, 'Usuario', 'Jonas que dia vc vai vir receber.\r\nfavor me avisar.\r\nAtt Elisiane', '2013-07-24', 28),
(99, 'Suporte', 'Estarei passando por ai na semana do dia 29/07/13, gostaria de apresentar a nova versão desenvolvida do sistema atual.. por isso estarei pessoalmente com vocês.. estarei agendando uma data mais especifica no começo da semana.. obrigado .. até mais. ', '2013-07-26', 28),
(100, 'Usuario', 'ok..', '2013-07-30', 28),
(101, 'Usuario', 'Joanas t. que dia vc vem receber,e as carteirinhas estão muito grande,favor diminuir o tamanho.', '2013-09-06', 29),
(102, 'Suporte', 'OIa, sobre a carteirinha estamos providenciando melhorias..\r\n\r\nSobre as mensalidades estarei indo este final de semana, mas provavel dia 14/09 na parte da tarde..\r\n\r\nTambem estaremos disponibilizando o novo sistema para a utilização a partir de sabado, e caso houver duvidas, falhas ou outros, por favor, contate-nos, e assim na medida do possivel estaremos atendendo.. \r\n\r\nobrigado por enquanto ..', '2013-09-12', 29),
(103, 'Usuario', 'ok', '2013-09-13', 29),
(104, 'Usuario', 'Não estou conseguindo abrir o novo programa só o velho,fica carregando e não abre.', '2013-10-24', 30),
(105, 'Suporte', 'Bom dia, sobre o não carregamento do sistema não conseguir simular esta situação, esta funcionando corretamente em nossos testes, caso o problema persista, gostaríamos que fossemos informados novamente, pois a principio este sistema não deve trazer este tipo de problema. \r\nApenas para ressaltar o dito anteriormente, para melhor funcionamento e desempenho da aplicação sugerimos o NÃO uso do navegador Internet Explorer(IE), sendo que os demais todos são compatíveis (Chrome, Firefox). Obrigado', '2013-10-30', 30),
(106, 'Usuario', 'ok', '2013-10-30', 30),
(107, 'Usuario', 'Jonas olha pra fazer associação tem apenas 2013.\r\nque dia vc vem...', '2014-02-17', 31),
(109, 'Usuario', 'ok', '2014-03-06', 32),
(110, 'Usuario', 'as carteirinhas ainda estão muito grande ainda...\r\nnão dobra no meio,sempre fica as letras escondidas.\r\n', '2014-03-06', 33),
(111, 'Usuario', 'que dia vc vem receber e qto devemos.', '2014-06-26', 34),
(112, 'Suporte', 'Boletos enviado para o email sindicatob@smo.com.br\r\nqqer duvida estamos a disposição', '2014-09-09', 34),
(113, 'Usuario', 'responder\r\nemail errado\r\nsindicatobarracao@hotmail.com', '2014-09-25', 34);
